import React from "react";
import classes from './Header.module.css';

const Header = (props) => {
  return (
    <header>
      <div class={classes[brand-name]}>Your Brand</div>
      <nav class={classes.nav}>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Tasks</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
          <li>
            <a href="#">FAQs</a>
          </li>
        </ul>
      </nav>
      <div class="user">
        <span>John Doe</span>
      </div>
    </header>
  );
};

export default Header;
